import React from 'react';
import { Route, Switch} from 'react-router'
import CardList from "./components/CardList.jsx";
import 'boostrap/dist/css/boostrap.css'
import ImageListPage from './components/startpage.jsx';
import layoutsimple from './components/layoutsimple'
import startpage from './components/startpage'
import "./App.css"

function App() {
   return (
    <div className="App">
    <Switch>

  <Route path="/Image/:id" render={ props => {
      return (
      <layoutsimple>
      <ImageDetailList {...props} />  
    </layoutsimple>  
     )
    }} >
    </Route>


      <Route path="/ImageList">
      <layoutsimple>
      <ImageListPage/>  
    </layoutsimple>  
    </Route>

   <Route path="/">
    <layoutsimple>  
    <startpage/>
    </layoutsimple>  
    </Route>

  </Switch >
  </div>

   );
  }

export default App;
